구좌읍 하도리에 있는 철새도래지로, 둑을 사이에 두고 바닷가와 연안습지가 발달해있다. 습지는 민물과 바닷물이 섞여 월동하는 철새의 먹이가 풍부하며, 습지 남쪽으로는 넓은 갈대밭이 있어 철새들의 은신처 및 번식지를 제공한다. 매년 30종에 이르는 3000~5000여 마리의 철새가 날아오는데, 천연기념물인 저어새와 노랑부리저어서, 고니, 매 뿐만 아니라 오리류, 물떼새류, 도요새류, 기러기류, 논병아리류, 가마우지류, 아비류 등의 철새가 모여든다.&nbsp;


&nbsp;「제주특별자치도 및 국제자유도시 특별법」에 의한 특별보호구역으로 지정되어 도내 학생과 일반인에 철새 탐조를 제공하고 있다.&nbsp;


