제주 올레 8코스는 월평 아왜낭목 쉼터를 시작으로 대평포구까지 걷는 코스로 

중문색달해변을 들리는&nbsp;A코스(19.2km)와 그렇지 않은 B코스(18.2km)로 나뉘며 약 5~6시간 정도 소요된다.&nbsp;


아왜나무 군락지가 있는 아왜낭목 쉼터에서 출발하여 보기 드문 3층 법당의 약천사를 지나면,&nbsp;풀숲 사이로 흐르는 선궷내의 물줄기를 볼 수 있다.&nbsp;

