내천을 따라 바다로 내려가 대포포구를 지나면 중문 해수욕장 인근에 빼어난 경치를 자랑하는&nbsp;우리나라 최대의 주상절리대를 만날 수 있다.&nbsp;

두꺼운 용암이 바다와 만나 급격히 식으면서 형성된 주상절리는 정교하게 겹겹이 쌓은 듯한 육각형의 돌기둥과,&nbsp;

탁 트이는 바다 풍경이 합쳐져 자연의 위대함과 절묘함을 동시에 느낄 수 있다.&nbsp;


주상절리의 검은 돌들과 함께 걷다 보면 ‘별이 내린 내’라는 뜻의 베릿내가 흐르는 베릿내오름이 기다리고 있다.&nbsp;

정상에 서면 남쪽으로 탁 트인 남태평양과 맑은 날이면 그 위에 떠있는 마라도, 가파도도 한눈에 볼 수 있다.&nbsp;

???????오름에서 내려오면 중문색달해변으로 향하는 A코스와 바로 중문관광단지안내소로 향하는 B코스로 나뉘게 된다.


