중문색달해변은 긴 백사장과 흑, 백, 적, 회색 등의 네 가지색을 띤 진모살이라는 모래를 볼 수 있는 특별한 곳이다.&nbsp;

진모살과 제주도 현무암의 조화가 아름다워 영화나 드라마의 단골 촬영지이기도 하다. 

아름다운 바다를 바라보며 해안절벽을 따라 생태관관을 할 수도 있고 여름에는 서핑을 즐기는 서퍼들뿐만 아니라&nbsp;

패러세일링, 윈드서핑 등 해양레포츠를 즐기기 위해 많은 사람들이 찾는 곳으로 즐거운 시간을 보낼 수 있다.


